pragma solidity >= 0.4.11;

import "/Users/derickkazimoto/Desktop/FinTech_and_Cryptocurrencies/Co/openzeppelin-contracts-master/contracts/token/ERC20/ERC20.sol";
import "/Users/derickkazimoto/Desktop/FinTech_and_Cryptocurrencies/Co/openzeppelin-contracts-master/contracts/ownership/Ownable.sol";

contract Co is Ownable, ERC20{

    address payable public minter;
    uint public mintedTokens = 0; //Assumes minting of tokens is done in whole numbers only!!
    //uint public withdrawnFunds = 0;
    //address payable public bondingCurve;

    mapping(address => uint) public coTokens;
    //uint public nCoTokens;
    //uint public buyValue;
    //uint public sellValue;


    constructor() public{
        minter = msg.sender;
    }

    // Function that fetches the buying price of coTokens from the bonding curve
    // f(x) = 0.01x + 0.2
    //The price is in ether
    function buyPrice(uint nCoTokens) public view returns(uint){
        //Check if the required number of coTokens is available;
        require((100 - mintedTokens) >= nCoTokens, "Exceeded the amount of nCoTokens available");
        //Initiate  price of ether at a given supply of tokens;
        uint initialCurvePrice = (0.01 ether * mintedTokens);
        //Buy value price at a given supply of CoTokens
        uint buyValue = initialCurvePrice + ((0.01 ether * nCoTokens) + (0.2 ether));

        return buyValue;
    }

    function sellPrice(uint nCoTokens) public view returns (uint){
        //Check if account selling tokens to the bonding curve posses those tokens
        //require(coTokens[account] >= nCoTokens, "Can not sell tokens that's not owned by account");
        //Initiate  price of ether at a given supply of tokens;
        uint initialCurvePrice = (0.01 ether* mintedTokens);
        //Sell value price at a given supply of CoTokens
        uint sellValue = ((0.01 ether * nCoTokens) + (0.2 ether)) - initialCurvePrice ;
        //return the sellvalue of coToken give the current supply of tokens(mintedTokens)
        return sellValue;
    }

    // function that checks the number of coTokens to be mintedTokens
    // Given a certain amount of ether
    function mint(address account, uint nCoTokens) public payable {

        //amount - number tokens to be minted
        //Co only wants to raise 100 tokens
        require(mintedTokens <= 100,"Only 100 tokens to be minted");

        //require(msg.value == buyPrice(tokenSupply(amount)), "");
        require(buyPrice(nCoTokens) == msg.value, "Enter exact amount for tokens buyPrice() function");

        //Sends amount paid by account to mint the tokens
        minter.transfer(msg.value);

        //add the number of minted tokens to account
        //coTokens[account] += nCoTokens;
        _mint(account, nCoTokens);
        //add the count of minted CoTokens
        mintedTokens += nCoTokens;

        //transfer the amount used to buy tokens to minter
        //transferFrom(account, minter, buyPrice(nCoTokens));

    }

    function burn(address account, uint nCoTokens) public onlyOwner payable{

        //only owner can call this function
        //amount is the number of tokens owner/minter wants to burn;
        //ERC20 _burn function owner burns tokens
        _burn(account,nCoTokens);

        //amount ether owner sends to self by burning down tokens
        minter.transfer(sellPrice(nCoTokens));

        //The total number of minted tokens  reduced/burned
        mintedTokens-= nCoTokens;
    }
    function destroy() public onlyOwner{
        //require all CoTokens are owned by minter
        require(balanceOf(minter) == 100, "For owner needs to own all tokens to destroy the contract");
        //self destruct function to destroy the contract
        selfdestruct(minter);
    }
}
